function BuildPost({ el }) {
  console.log(el);
  return (
    <div className='card'>
      <h1>cliked post</h1>
      <h3>{el.buildname} </h3>
      {el.photos.map((el) =>
        el.backgroundimage.map((el) => <img className='buildcardIMG' src={el.path} alt='background' />)
      )}
      <h3>{el.description}</h3>
    </div>
  );
}

export default BuildPost;
